  import React, { useEffect } from 'react';
  //import React from 'react';
  import About from './pages/About';
  import Cart from './pages/Cart';
  import Catalog from './pages/Catalog';
  import CatalogByCategories from './pages/CatalogByCategories'
  import CreateOrder from './pages/CreateOrder';
  import Index from './pages/Index';
  import Login from './pages/Login';
  import Product from './pages/Product';
  import Profile from './pages/Profile';
  import Registration from './pages/Registration';
  import { BrowserRouter, Routes, Route } from 'react-router-dom';
  import Header from './components/Header';
  import Footer from './components/Footer';
  import Chat from './components/Chat'; 
  import { logEvent } from './utils/logger';
  import './i18n.js'; 


  const App = () => {
    useEffect(() => {
        logEvent('info', 'React app mounted');
    }, []);

    const handleClick = () => {
        logEvent('warning', 'Button clicked', { buttonId: 'myButton' });
    };
    return (
      <div>
        <Header />
        <BrowserRouter>
          <Routes>
            <Route path='/about' element={<About />} />
            <Route path='/cart' element={<Cart />} />
            <Route path='/catalog' element={<Catalog />} />
            <Route path='/catalog/categories/:category' element={<CatalogByCategories />} />
            <Route path='/create_order' element={<CreateOrder />} />
            <Route path='/' element={<Index />} />
            <Route path='/login' element={<Login />} />
            <Route path='/product' element={<Product />} />
            <Route path='/product/:name' element={<Product />} />
            <Route path='/profile' element={<Profile />} />
            <Route path='/registration' element={<Registration />} />
            
          </Routes>
          <Chat /> {}
        </BrowserRouter>
        <Footer />
      </div>
    );
  };

  export default App;
